var rawData = "";

d3.select("body").append("div").attr("class", "tip").style("display", "none");

var margin = {top: 20, bottom: 1, left: 20, right: 1};

var dim = d3.min([window.innerWidth * .8, window.innerHeight * .8]);

var width = dim - margin.left - margin.right, height = dim - margin.top - margin.bottom;

var svg = d3.select("#pins").append("svg")
    .attr("width", width + margin.left + margin.right)
    .attr("height", height + margin.top + margin.bottom)
    .append("g")
    .attr("transform", "translate(" + margin.left + ", " + margin.top + ")");

var padding = 0;

var x = d3.scaleBand()
    .range([0, width])
    .paddingInner(padding);

var y = d3.scaleBand()
    .range([0, height])
    .paddingInner(padding);

function generateData(){
    var data = [];

    var decoded = window.atob(rawData);
    var buffer = new ArrayBuffer(decoded.length);
    var bytes = new Uint8Array(buffer);
    for(var i = 0; i < decoded.length; i++) {
        bytes[i] = decoded.charCodeAt(i);
    }

    var view = new DataView(buffer);

    function rgb(r, g, b) {
        return "rgb(" + r + "," + g + "," + b + ")";
    }

    function color(r, g, b) {
        var average = Math.floor((r + g + b) / 3);
        return {normal: rgb(r, g, b), bw: rgb(average, average, average)};
    }

    function colorFromFloat(f) {
        var t1 = 0.4, t2 = 0.6;
        return f < t1 ? color(Math.floor(255 * f / t1), 0, 0)
            : (f < t2 ? color(255, Math.floor(255 * (f - t1) / (t2 - t1)), 0)
                : color(255, 255, Math.floor(255 * (f - t2) / (1 - t2))));
    }

    for(i = 0; i < decoded.length / 4; i++) {
        var f = view.getFloat32(4 * i, false);
        data.push({id: i, value: f, row: 99 - (i % 100) + 1, column: Math.floor(i / 100) + 1, colors: colorFromFloat(f), pin: ("000" + i).slice(-4)});
    }

    return data;
}


d3.selectAll(("input[name='radio-highlight']")).on("change", function() {
    var func;
    if(this.value === 'all') {
        func = function(pin) { return true; };
    } else if(this.value === 'repetition') {
        func = function(pin) {
            var set = new Set();
            for(var i = 0; i < pin.length; i++) {
                set.add(pin.charCodeAt(i));
            }
            return set.size < 4;
        };
    } else if(this.value === 'sequence') {
        func = function (pin) {
            var last = pin.charCodeAt(0);
            for (var i = 1; i < pin.length; i++) {
                var c = pin.charCodeAt(i);
                if (c !== last + 1 && c !== last && c !== last - 1) {
                    return false;
                }
                last = c;
            }
            return true;
        };
    } else if(this.value === 'palindrome') {
        func = function(pin) {
            return pin === pin.split("").reverse().join("");
        };
    } else if(this.value === 'double') {
        func = function(pin) {
            return pin.substr(0, 2) === pin.substr(2, 2);
        };
    } else if(this.value === 'year') {
        func = function(pin) {
            var p = parseInt(pin);
            return p >= 1850 && p <= 2018
        }
    } else if(this.value === 'date') {
        func = function(pin) {
            var a = parseInt(pin.substr(0, 2)), b = parseInt(pin.substr(2, 2));
            function getDaysInMonth(m, y) { // https://stackoverflow.com/a/27947885/4413709
                return m === 2 ? y & 3 || !(y%25) && y & 15 ? 28 : 29 : 30 + (m+(m>>3)&1);
            }
            var isValid = function(a, b) { return a >= 1 && a <= 12 && b >= 1 && b <= getDaysInMonth(a, 0) };
            return isValid(a, b) || isValid(b, a);
        }
    }

    svg.selectAll("rect")
        .style("fill", function(d, i) { return func(d.pin) ? d.colors.normal : d.colors.bw; });
});

draw(generateData());

function draw(data){
    var grid = data;
    var rows = d3.max(grid, function(d){ return d.row; });

    x.domain(d3.range(1, rows + 1));
    y.domain(d3.range(1, rows + 1));

    var square = svg.selectAll("rect")
        .data(grid, function(d){ return d.id; });

    square.enter().append("rect")
        .attr("x", function(d){ return x(d.column); })
        .attr("y", function(d){ return y(d.row); })
        .attr("width", x.bandwidth())
        .attr("height", y.bandwidth())
        .style("fill", function(d){ return d.colors.normal; })
        .style("stroke", function(d){ return d.colors.normal; })
        .style("stroke-width", "0px") // Stroke was removed because of lags
    ;

    d3.selectAll("rect")
        .on("mouseover", function(d){

            d3.select(this)
                .classed("selected", true);

            d3.select(".tip")
                .style("display", "block")
                .html(d.pin);

            var row_pos = y(d.row);
            var col_pos = x(d.column);
            var tip_pos = d3.select(".tip").node().getBoundingClientRect();
            var tip_width = tip_pos.width;
            var tip_height = tip_pos.height;
            var grid_pos = d3.select("#pins").node().getBoundingClientRect();
            var grid_left = grid_pos.left;
            var grid_top = grid_pos.top;

            var left = grid_left + col_pos + margin.left + (x.bandwidth() / 2) - (tip_width / 2);
            var top = grid_top + row_pos + margin.top - tip_height - 5;

            d3.select(".tip")
                .style("left", left + "px")
                .style("top", top + "px");
        })
        .on("mouseout", function(){
            d3.selectAll("rect").classed("selected", false);
            d3.select(".tip").style("display", "none");
        });
}